import "./home.css";
import React from 'react'
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';

//Bootstrap
import {Container, Grid, Row} from "react-bootstrap";

export default function Home() {
    return (
        <>
            <Container>
                <h1 className="text-center">Create a new quiz</h1>
            </Container>
        </>
    )
}
